import React from "react";
import "./App.css";
import colors from "./data";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      inputTextValue: ''
    }
  }

  render() {
    // console.log(colors);
    // console.log(this);
    return (
      <ul>
        {colors.map((color, index) => (
          <li key={index}>
            <div className="color-square" style = {{backgroundColor: color.value}}></div>
            {color.color}
          </li>
        ))}
      </ul>
    );
  }
}

export default App;
